- apiVersion: v1
  data:
    gnb.yaml: "mcc: 999 # Mobile Country Code value\nmnc: 70 # Mobile Network Code
      value (2 or 3 digits)\n\nnci: '0x0000000100'  # NR Cell Identity (36-bit)\nidLength:
      32        # NR gNB ID length in bits [22...32]\ntac: 0001             # Tracking
      Area Code\n\nlinkIp: ${RADIO_BIND_IP}   # gNB's local IP address for Radio Link
      Simulation (Usually same with local IP)\nngapIp: ${N2_BIND_IP}  # gNB's local
      IP address for N2 Interface (Usually same with local IP)\ngtpIp: ${N3_BIND_IP}
      \  # gNB's local IP address for N3 Interface (Usually same with local IP)\n\n#
      List of AMF address information\namfConfigs:\n  - address: 172.16.5.75 \n    port:
      38412\n\n# List of supported S-NSSAIs by this gNB\nslices:\n  - sst: 1\n \n\n#
      Indicates whether or not SCTP stream number errors should be ignored.\nignoreStreamIds:
      true\n"
